    false,nt"url": null,nt"notes": "GAO was asked to (1) describe changing
    factors that the refuge system experienced from fiscal years 2002 through 2007,
    including funding and staffing changes, and (2) examine how habitat management and
    visitor services changed during this period. GAO surveyed all refuges; visited 19
    refuges in 4 regions; and interviewed refuge, regional, and national officials.
    For fiscal years 2002 through 2007, funding and staffing levels for the refuge system
    fluctuated, several new refuge system policy initiatives were introduced, and the
    influence of external factors such as extreme weather and human development that
    affect refuge operations increased: funding, staffing, policy initiatives, external
    factors, habitat management, and visitor services.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
